import kfp
from kfp.v2 import dsl
from kfp.v2.dsl import *
from typing import *

def build_serialized_query_parameters(
    forecast_horizon: Optional[int] = None,
    forecast_horizon_off_by_one: bool = False,
    data_granularity_unit: Optional[str] = None,
    splits: Optional[List[str]] = None,
    window: Optional[Dict[str, str]] = None,
    max_order: Optional[int] = None,
) -> list:  # pylint: disable=g-bare-generic
  """Creates configuration JSON objects for BQML queries.

  All query parameters will be stored in a list of QueryParameter objects:
  https://cloud.google.com/bigquery/docs/reference/rest/v2/QueryParameter

  Args:
    forecast_horizon: The number of time periods into the future for which
      forecasts will be created. Future periods start after the latest timestamp
      for each time series.
    forecast_horizon_off_by_one: If True, subtract 1 from the forecast horizon
      in the query parameters.
    data_granularity_unit: The data granularity unit. Accepted values are:
      minute, hour, day, week, month, year.
    splits: Dataset splits to be used to train the model.
    window: Dict containing information about the forecast window the model
      should have. If no window is provided, the window will start after the
      latest period in the available data.
    max_order: Integer between 1 and 5 representing the size of the parameter
      search space for ARIMA_PLUS. 5 would result in the highest accuracy model,
      but also the longest training runtime.

  Returns:
    A list of QueryParameters.
  """
  # pylint: disable=g-import-not-at-top,import-outside-toplevel
  import datetime
  # pylint: enable=g-import-not-at-top,import-outside-toplevel

  # Maps Vertex Forecasting time units to BQML time units.
  unit_map = {
      'minute': 'per_minute',
      'hour': 'hourly',
      'day': 'daily',
      'week': 'weekly',
      'month': 'monthly',
      'year': 'yearly',
  }
  query_parameters = []
  if data_granularity_unit is not None:
    if data_granularity_unit.lower() not in unit_map:
      raise ValueError(f'{data_granularity_unit} is not a valid time unit. '
                       f'Must be one of: {", ".join(unit_map.keys())}')
    query_parameters.append({
        'name': 'data_granularity_unit',
        'parameterType': {'type': 'STRING'},
        'parameterValue': {
            'value': unit_map[data_granularity_unit.lower()],
        },
    })
  if max_order is not None:
    query_parameters.append({
        'name': 'max_order',
        'parameterType': {'type': 'INTEGER'},
        'parameterValue': {'value': str(max_order)},
    })
  if forecast_horizon is not None:
    if forecast_horizon_off_by_one:
      forecast_horizon -= 1
    query_parameters.append({
        'name': 'forecast_horizon',
        'parameterType': {'type': 'INTEGER'},
        'parameterValue': {'value': str(forecast_horizon)},
    })
  if splits is not None:
    query_parameters.append({
        'name': 'splits',
        'parameterType': {
            'type': 'ARRAY',
            'arrayType': {'type': 'STRING'},
        },
        'parameterValue': {
            'arrayValues': [{'value': split} for split in splits],
        },
    })

  if window is not None:
    query_parameters.append({
        'name': 'prediction_count',
        'parameterType': {'type': 'INTEGER'},
        'parameterValue': {'value': window['count']},
    })

  start_time = window['start_time'] if window else str(datetime.datetime.max)
  query_parameters.append({
      'name': 'start_time',
      'parameterType': {'type': 'TIMESTAMP'},
      'parameterValue': {'value': start_time},
  })
  return query_parameters

